import Category from "@/pages/story/components/content/Category";
import { useRef } from "react";

const CategoryCarousel = () => {
  const categorySample = [
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
    {
      title: "나안아",
      img: "data:image/jpeg;base64,",
    },
  ];

  const scrollRef = useRef(null);
  let isDown = false;
  let startX = 0;
  let scrollLeft = 0;

  const handleMouseDown = (e) => {
    isDown = true;
    const slider = scrollRef.current;
    slider.classList.add("grabbing");
    startX = e.pageX - slider.offsetLeft;
    scrollLeft = slider.scrollLeft;
  };

  const handleMouseLeave = () => {
    isDown = false;
    scrollRef.current.classList.remove("grabbing");
  };

  const handleMouseUp = () => {
    isDown = false;
    scrollRef.current.classList.remove("grabbing");
  };

  const handleMouseMove = (e) => {
    if (!isDown) return;
    e.preventDefault();
    const slider = scrollRef.current;
    const x = e.pageX - slider.offsetLeft;
    const walk = (x - startX) * 1.6; // sensitivity 조정 가능
    slider.scrollLeft = scrollLeft - walk;
  };

  return (
    <div
      ref={scrollRef}
      className="w-full m-5 overflow-x-auto whitespace-nowrap scrollbar-hide cursor-grab"
      onMouseDown={handleMouseDown}
      onMouseLeave={handleMouseLeave}
      onMouseUp={handleMouseUp}
      onMouseMove={handleMouseMove}
    >
      <div className="inline-flex gap-2">
        {categorySample.map((item, idx) => (
          <Category key={idx} title={item.title} img={item.img} idx={idx} />
        ))}
      </div>
    </div>
  );
};

export default CategoryCarousel;
